-- tables
-- Table: ADVERTENCIA
CREATE TABLE ADVERTENCIA (
    ID_ADV int  NOT NULL IDENTITY(1,1),
    DES_ADV nvarchar(300)  NOT NULL,
    CONSTRAINT ADVERTENCIA_pk PRIMARY KEY  (ID_ADV)
);

-- Table: DISTRITO
CREATE TABLE DISTRITO (
    ID_DIS int  NOT NULL IDENTITY(1,1),
    DES_DIS nvarchar(100)  NOT NULL,
    CONSTRAINT DISTRITO_pk PRIMARY KEY  (ID_DIS)
);

-- Table: FARMACIA
CREATE TABLE FARMACIA (
    ID_FAR int  NOT NULL IDENTITY(1,1),
    ID_DIS int  NOT NULL,
    NOM_FAR nvarchar(100)  NOT NULL,
    DIR_FAR nvarchar(300)  NULL,
    CORX_FAR decimal(8,6)  NULL,
    CORDY_FAR decimal(8,6)  NULL,
    HORARIO_FAR nvarchar(50)  NULL,
    GEO_LUGAR geography  NULL,
    CONSTRAINT FARMACIA_pk PRIMARY KEY  (ID_FAR)
);

-- Table: FAVORITO
CREATE TABLE FAVORITO (
    ID_FAV int  NOT NULL IDENTITY(1,1),
    ID_MED int  NOT NULL,
    ID_USU int  NOT NULL,
    CONSTRAINT FAVORITO_pk PRIMARY KEY  (ID_FAV)
);

-- Table: FORMA_USO
CREATE TABLE FORMA_USO (
    ID_FOR int  NOT NULL IDENTITY(1,1),
    DES_FOR nvarchar(300)  NOT NULL,
    CONSTRAINT FORMA_USO_pk PRIMARY KEY  (ID_FOR)
);

-- Table: LABORATORIO
CREATE TABLE LABORATORIO (
    ID_LAB int  NOT NULL IDENTITY(1,1),
    NOM_LAB nvarchar(300)  NOT NULL,
    CONSTRAINT LABORATORIO_pk PRIMARY KEY  (ID_LAB)
);

-- Table: MEDICAMENTO
CREATE TABLE MEDICAMENTO (
    ID_MED int  NOT NULL IDENTITY(1,1),
    ID_ADV int  NOT NULL,
    ID_FOR int  NOT NULL,
    ID_PRE int  NOT NULL,
    ID_LAB int  NOT NULL,
    ID_SIN int  NOT NULL,
    NOM_MED nvarchar(200)  NOT NULL,
    CON_MED nvarchar(100)  NULL,
    CONSTRAINT MEDICAMENTO_pk PRIMARY KEY  (ID_MED)
);

-- Table: MEDICAMENTO_FARMACIA
CREATE TABLE MEDICAMENTO_FARMACIA (
    ID_MED int  NOT NULL,
    ID_FAR int  NOT NULL,
    PRECIO money  NOT NULL,
    CONSTRAINT MEDICAMENTO_FARMACIA_pk PRIMARY KEY  (ID_MED,ID_FAR)
);

-- Table: PERSONA
CREATE TABLE PERSONA (
    PER_ID int  NOT NULL IDENTITY(1,1),
    ID_USU int  NOT NULL,
    NOM_PER nvarchar(60)  NOT NULL,
    APEP_PER nvarchar(60)  NOT NULL,
    APEM_PER nvarchar(60)  NOT NULL,
    FNAC_PER datetime  NULL,
    CONSTRAINT PERSONA_pk PRIMARY KEY  (PER_ID)
);

-- Table: PRESENTACION
CREATE TABLE PRESENTACION (
    ID_PRE int  NOT NULL IDENTITY(1, 1),
    DES_PRE nvarchar(200)  NOT NULL,
    CONSTRAINT PRESENTACION_pk PRIMARY KEY  (ID_PRE)
);

-- Table: PROMOCION
CREATE TABLE PROMOCION (
    ID_PRO int  NOT NULL IDENTITY(1,1),
    ID_MED int  NOT NULL,
    ID_FAR int  NOT NULL,
    DES_PRO nvarchar(300)  NOT NULL,
    CONSTRAINT PROMOCION_pk PRIMARY KEY  (ID_PRO,ID_MED,ID_FAR)
);

-- Table: SINTOMA
CREATE TABLE SINTOMA (
    ID_SIN int  NOT NULL IDENTITY(1, 1),
    DES_SIN nvarchar(200)  NOT NULL,
    CONSTRAINT SINTOMA_pk PRIMARY KEY  (ID_SIN)
);

-- Table: USUARIO
CREATE TABLE USUARIO (
    ID_USU int  NOT NULL IDENTITY(1,1),
    NOM_USU nvarchar(30)  NOT NULL,
    PASS_USU nvarchar(30)  NOT NULL,
    CORREO_USU nvarchar(150)  NULL,
    CONSTRAINT USUARIO_pk PRIMARY KEY  (ID_USU)
);

