CREATE PROCEDURE USP_FARMACIA_X_FILTRO
@FILTRO VARCHAR(50) = ''
AS
	SELECT TOP 20 F.* 
	FROM FARMACIA F 
	INNER JOIN DISTRITO D ON F.ID_DIS = D.ID_DIS
	WHERE D.DES_DIS LIKE '%'+@FILTRO+'%'
	OR F.NOM_FAR LIKE '%'+@FILTRO+'%'
	OR F.DIR_FAR LIKE '%'+@FILTRO+'%'
GO

