INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('En caso de una sobredosis de METAMIZOL SÓDICO, se requiere asistencia médica. Si el paciente está consciente, inducir el vómito con solución salina tibia, seguido de estimulación mecánica de la pared faríngea posterior.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('En niños de 1 a 6 años, emplear jugo de fruta tibio en cantidades adecuadas a su edad.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('METAMIZOL SÓDICO puede eliminarse mediante hemo­diálisis.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('KETOROLACO debe ser administrado bajo una programación o dependiendo del tipo y severidad de la enfermedad.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('KETOROLACO puede ser administrado intramuscular, intravenoso u oralmente. La dosis intravenosa debe ser administrada por lo menos en 15 segundos.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('KETOROLACO inyectable contiene alcohol y no deberá ser administrado intratecal o epiduralmente.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Por el riesgo de anafilaxis y otras reacciones alérgicas severas, equipo y medicación para el tratamiento de estas complicaciones debe estar disponible para el inmediato uso cuando la primera dosis de KETOROLACO  es administrada.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Puede producir somnolencia. Evitar ingesta de bebidas alcohólicas. Mantener alejado de los niños.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Contiene sulfitos que pueden causar reacciones de hipersensibilidad, especialmente en asmáticos.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Las inyecciones intravenosas de dosis masiva deben administrarse lentamente, durante un período de varios minutos.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Administrar las inyecciones intra-articulares en condiciones asépticas, ya que dexametasona reduce la resistencia a la infección.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Mantener fuera del alcance de los niños.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('No exceder la velocidad de administración.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Riesgo de sensibilidad cruzada con antihistamínicos.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Asma bronquial, enfisema, bronquitis crónica, EPOC.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Riesgo de agravar: hipertrofia prostática, retención urinaria, enf. obstructivas del tracto urinario y gastrointestinales, HTA, glaucoma de ángulo cerrado, hipertiroidismo, epilepsia.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Por su efecto antiemético puede interferir en diagnóstico de apendicitis.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('La administración de este medicamento debe realizarse con especial precaución en pacientes con insuficiencia cerebrovascular y en pacientes con enfermedad cardiaca como angina de pecho o infarto de miocardio.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('En pacientes con enfermedad pulmonar crónica y con dificultad urinaria debido a hipertrofia prostática.')
INSERT INTO ADVERTENCIA (DES_ADV) VALUES ('Administrar con Advertencias y precauciones en pacientes con taquicardia')
